package implement_strstr;

import util.Ring;

import java.util.function.Function;
import java.util.stream.IntStream;

public class Solution {

    public int strStr(String haystack, String needle) {
        if (haystack == null || needle == null) return -1;

        final Ring r = new Ring(9973);
        final int len = needle.length();
        final int x = 101;

        int i;

        if (len == 0) return 0;
        if (haystack.length() < len) return -1;

        Function<String, Integer> ring_hash = (source) ->
            IntStream.range(0, len)
                    .map(idx -> r.mult(source.charAt(idx), r.pow(x, len - idx - 1)))
                    .reduce(r::add).getAsInt();

        int needle_hash = ring_hash.apply(needle);;
        int substr_hash = ring_hash.apply(haystack);

        for (i = 0; i < haystack.length() - len && substr_hash != needle_hash; i++) {
            substr_hash = r.add(substr_hash, -r.mult(haystack.charAt(i), r.pow(x, len - 1)));
            substr_hash = r.mult(substr_hash, x);
            substr_hash = r.add(substr_hash, haystack.charAt(i + len));
        }
        if (substr_hash == needle_hash) return i;

        return -1;
    }

    public static void main(String[] args) {
        System.out.println(new Solution().strStr("mississippi", "issi"));
        System.out.println(new Solution().strStr("mississippi", "issip"));
//        System.out.println(new Solution().strStr( "",

//                ""
//        ));
    }

}


